INSERT INTO `account_profile` VALUES (2,'Jarl og','Marianne','','http://mandlen.dk','0000-00-00','Mandelglad og glutenfri:\r\n\r\nIngen gluten og ingen m&aelig;lkeprodukter. S&aring;dan l&oslash;d det fra l&aelig;gen og di&aelig;tisten tilbage i 2007 til vores dengang 3 &aring;rige s&oslash;n.\r\n\r\nI starten fulgte han en di&aelig;t helt uden kornprodukter og stivelse. Mandelmel og pureer sikrede ham gode n&aelig;ringstoffer og olier, og mandlerne udgjorde en stor del af hans kost. Den lille dreng elskede sine muffins-lignende b&oslash;rnehaveboller med marcipansmag. Og mandelm&aelig;lk med vanille g&aring;r fantastisk til b&aring;de friske jordb&aelig;r, i smoothies og til den risengr&oslash;d, han senere i forl&oslash;bet kunne spise.\r\n\r\nI dag er han en st&aelig;rk og glad dreng med fuld fart p&aring;. Han spiser alt, s&aring; l&aelig;nge det er stadig er uden m&aelig;lk og gluten. Ogs&aring; den &oslash;vrige del af familien &ndash; Jarl, Marianne og lilles&oslash;ster - stortrives p&aring; kosten.\r\n\r\nMandler og n&oslash;dder har en stor plads i vores kost. Fordi de smager s&aring; godt! Og s&aring; er de i tilgift nemme og sunde&ndash; og en af de f&aring; snacks, man kan spise l&oslash;s af med god samvittighed ;-)\r\n\r\nHvad enten du kigger med her, fordi du trives bedst uden kom&aelig;lk og gluten, godt kan lide mandler og n&oslash;dder &ndash; eller af en helt tredje grund, s&aring; h&aring;ber vi, at du finder noget, der kan inspirere dig og din kost.\r\n\r\nHar du sp&oslash;rgsm&aring;l eller kommentarer af enhver art, s&aring; skriv endelige til os. Vi gl&aelig;der os til at h&oslash;re fra dig.\r\n\r\nJarl og Marianne Schacht',2,'benjamin'),(3,'','','','',NULL,NULL,1,NULL),(4,'','','','',NULL,NULL,5,NULL),(5,'','','','',NULL,'Ejer',4,'Benjamin Lassesen');
