INSERT INTO `newsletter_archive` VALUES (7,'ForÃƒÂ¥rsnyt fra mandlen.dk   ','KÃƒÂ¦re mandelven\r\n\r\nSÃƒÂ¥ lykkedes det endelig at finde en god leverandÃƒÂ¸r af de lÃƒÂ¦kre ÃƒÂ¸kologiske mandler fra Sicilien. Lageret i Valby er nu fyldt op med mandler og mandelmel af fineste kvalitet.\r\n\r\nVi beklager meget den lange ventetid. Vores gode leverandÃƒÂ¸r i Frankrig satte i efterÃƒÂ¥ret priserne kraftigt op. Vi gik derfor pÃƒÂ¥ jagt efter nye leverandÃƒÂ¸rer. Vores ÃƒÂ¸nske var at fortsÃƒÂ¦tte med at forhandle de sÃƒÂ¸de og sprÃƒÂ¸de sicilienske mandler og holde fast i vores koncept om at sÃƒÂ¦lge ÃƒÂ¸kologiske kvalitetsmandler til lave priser.\r\n \r\nVi er derfor glade for at kunne prÃƒÂ¦sentere jer for mandler fra vores nye leverandÃƒÂ¸r. Mandlerne kommer direkte fra et lille familiefirma pÃƒÂ¥ Sicilien med 13 ÃƒÂ¥rs erfaring indenfor ÃƒÂ¸kologisk dyrkning af mandler. Vi har prÃƒÂ¸vesmagt mandler og mel, og de er rigtig gode.\r\n\r\nSom noget nyt tilbyder vi mandler og mel i flere forskellige stÃƒÂ¸rrelser. Udover 2 kg poser, kan I nu ogsÃƒÂ¥ fÃƒÂ¥ alle varer i 1 kg og 500 g poser. \r\n\r\nVi har ogsÃƒÂ¥ fÃƒÂ¥et en helt ny vare hjem: mÃƒÂ¸rkt mandelmel. Det er lavet af mandler malet med skrÃƒÂ¦l. Det mÃƒÂ¸rke mel egner sig rigtig godt til bagning og til mandelmÃƒÂ¦lk. Da skrÃƒÂ¦llen er med, er der et hÃƒÂ¸jt nÃƒÂ¦rings- og fiberindhold.\r\n\r\nDesvÃƒÂ¦rre er vi pÃƒÂ¥ trods af den nye gode leverandÃƒÂ¸r nÃƒÂ¸d til for fÃƒÂ¸rste gang i to ÃƒÂ¥r  at hÃƒÂ¦ve priserne en smule. Pr. 1. april ser priserne sÃƒÂ¥dan ud:\r\n\r\nMandelmel, hvid\r\n2 kg	 375,00 kr.\r\n1 kg	200,00 kr.\r\n500 g	110,00 kr\r\n\r\nMandelmel, mÃƒÂ¸rkt \r\n2 kg	350,00 kr. \r\n1 kg	185,00 kr.\r\n500 g	95,00 kr.\r\n\r\nMandler\r\n2 kg	290,00 kr.\r\n1 kg	150,00 kr.\r\n500 g	80,00 kr.\r\n\r\nRistede mandler\r\n2 kg	310,00 kr.    \r\n1 kg	160,00 kr\r\n500 g	90,00 kr.\r\n\r\nAlle bestillinger, der er modtaget inden 1. april, bliver naturligvis afregnet til Ã¢â‚¬ÂgammelÃ¢â‚¬Â pris. Vi glÃƒÂ¦der os meget til at hÃƒÂ¸re fra dig igen. Husk du er altid velkommen til at ringe eller skrive med spÃƒÂ¸rgsmÃƒÂ¥l, ris og ros.\r\n\r\nBemÃƒÂ¦rk at ogsÃƒÂ¥ PostDanmark ÃƒÂ¦ndrer priser pr. 1. april pÃƒÂ¥ privatpakker. Nogle stÃƒÂ¸rrelser bliver lidt billigere, andre et par kroner dyrere - se vores hjemmeside.\r\n\r\nBedste hilsner\r\n\r\nMandlen.dk\r\nJarl og Marianne Schacht\r\n','2011-03-27 13:30:55','a:7:{s:11:\"aline@pc.dk\";b:1;s:16:\"bjhansen@mail.dk\";b:1;s:19:\"lbsolskin@gmail.com\";b:1;s:24:\"dennis.iversen@gmail.com\";b:1;s:15:\"abj@adslhome.dk\";b:1;s:30:\"hanne.delinde@mercuriurval.com\";b:1;s:15:\"helle@ertner.dk\";b:1;}'),(9,'ÃƒËœkologiske mandler skal vÃƒÂ¦re til at betale','Vi har gennem tiden betalt formuer for smÃƒÂ¥ poser ÃƒÂ¸kologiske mandler. Indtil vi opdagede Mandlen.dk. Derfor var vi ikke i tvivl om, at Mandlen skulle fÃƒÂ¸res videre, da grundlÃƒÂ¦ggeren Anete BÃƒÂ¼hring sidste ÃƒÂ¥r flyttede udenlands. \r\n\r\nDet er snart et ÃƒÂ¥r siden. Tak til alle jer, der fulgte med Mandlen og til jer, der siden er kommet til. For os har det vÃƒÂ¦ret interessant og lÃƒÂ¦rerigt, at vÃƒÂ¦re ivÃƒÂ¦rksÃƒÂ¦ttere. FÃƒÂ¸rst skulle der en masse ny teknik til. SÃƒÂ¥ satte leverandÃƒÂ¸ren priserne voldsomt op. Vi var nÃƒÂ¸dt til at finde en ny for at holde fast i vores mission om at tilbyde sunde ÃƒÂ¸kologiske snacks til  priser, hvor alle kan vÃƒÂ¦re med. \r\n\r\nI marts kunne vi endelig prÃƒÂ¦sentere mandler fra vores nye leverandÃƒÂ¸r. Vi er nu snart klar til at fÃƒÂ¥ nÃƒÂ¦ste parti hjem. Denne gang med ÃƒÂ¸kologiske hasselnÃƒÂ¸dder og nye pureer. \r\n\r\nSiden sidst har Mandlen fÃƒÂ¥et  en blog pÃƒÂ¥ siden. Her blogger vi om nye tips og opskrifter med mandler og mel til diÃƒÂ¦tmad og ÃƒÂ¸kologi. Du er meget velkommen til at bidrage med dine egne erfaringer, tips og ideer! Du kan ogsÃƒÂ¥ finde os pÃƒÂ¥ Facebook. \r\n\r\nOm fÃƒÂ¥ uger starter ÃƒÂ¥rets Famers Market. Et initiativ fra OprÃƒÂ¸r fra Maven, der handler om fÃƒÂ¥ kvalitetsfÃƒÂ¸devarer ud til flere. Vi er med i JÃƒÂ¦